INSERT INTO `tb_ssh` VALUES (3909, NULL, 'Telkomsel Combo Sakti Unlimited 25GB +Unlimited', 'Kuota Utama sebesar 25 GB internet untuk akses internet di jaringan 2G/3G/4G. 300 Menit telepon ke sesama Telkomsel. 400 SMS ke sesama Telkomsel. Kuota Utama akan menjadi prioritas konsumsi pertama bagi pelanggan, kemudian diikuti Kuota Unlimited untuk beberapa apps sesuai ketentuan. Kuota Unlimited Apps akan otomatis dapat digunakan jika Kuota Utama telah habis tanpa ada batasan kecepatan dan kuota selama masa aktif paket masih berlaku pada aplikasi sesuai ketentuan yaitu: WhatsApp, LINE, MusicMAX, GamesMAX, MAXstream, Facebook, Instagram, YouTube dan TikTok.Akses internet ke aplikasi lain di luar Unlimited Apps jika Kuota Utama telah habis tetap bisa dilakukan tanpa batasan kuota dengan kecepatan maksimum 128 kbps (tanpa memotong pulsa pelanggan) selama masa aktif paket masih berlaku.', 'Rupiah', '119952', NULL, 'SSH', NULL, '2023', NULL, NULL, NULL, NULL);
INSERT INTO `tb_ssh` VALUES (3910, NULL, 'Telkmosel TAU Entertainment Extreme 70 GB - 30 hari', 'Paket TAU Entertainment Extreme 70 GB adalah paket bundling untuk pelanggan kartu prabayar terpilih dengan total kuota 70 GB yang terdiri dari 18 GB Kuota Utama, 12 GB Kuota 4G, 20 GB Kuota Malam dan 20 GB Kuota Entertainment.', 'Rupiah', '257040', NULL, 'SSH', NULL, '2023', NULL, NULL, NULL, NULL);
